BEGIN TRANSACTION;
DROP TABLE IF EXISTS "genres";
CREATE TABLE genres(
	id INTEGER PRIMARY KEY AUTOINCREMENT,
	name TEXT NOT NULL UNIQUE
);
DROP TABLE IF EXISTS "movie_genres";
CREATE TABLE movie_genres (
    movie_id INTEGER,
    genre_id INTEGER,
    PRIMARY KEY (movie_id, genre_id),
    FOREIGN KEY (movie_id) REFERENCES movies(id),
    FOREIGN KEY (genre_id) REFERENCES genres(id)
);
DROP TABLE IF EXISTS "movies";
CREATE TABLE movies (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    title TEXT NOT NULL,
    year INTEGER
);
DROP TABLE IF EXISTS "occupations";
CREATE TABLE occupations (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    name TEXT UNIQUE NOT NULL
);
DROP TABLE IF EXISTS "ratings";
CREATE TABLE ratings (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    user_id INTEGER,
    movie_id INTEGER,
    rating REAL CHECK(rating >= 0.0 AND rating <= 5.0),
    timestamp INTEGER,
    FOREIGN KEY (movie_id) REFERENCES movies(id) ON DELETE RESTRICT,
    FOREIGN KEY (user_id) REFERENCES users(id) ON DELETE CASCADE
);
DROP TABLE IF EXISTS "tags";
CREATE TABLE tags (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    user_id INTEGER,
    movie_id INTEGER,
    tag TEXT,
    timestamp INTEGER NOT NULL,
    FOREIGN KEY (movie_id) REFERENCES movies(id),
    FOREIGN KEY (user_id) REFERENCES users(id) ON DELETE CASCADE
);
DROP TABLE IF EXISTS "users";
CREATE TABLE users (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    name TEXT,
    email TEXT UNIQUE,
    gender TEXT CHECK (gender in ('male', 'female')),
    register_date DATE NOT NULL,
    occupation_id INTEGER,
    FOREIGN KEY (occupation_id) REFERENCES occupations(id)
);
DROP INDEX IF EXISTS "name_idx";
CREATE INDEX name_idx ON users(name);
DROP INDEX IF EXISTS "title_idx";
CREATE INDEX title_idx ON movies(title);
DROP INDEX IF EXISTS "year_idx";
CREATE INDEX year_idx ON movies(year);
COMMIT;
